import React from "react";
import SkillBar from "../components/SkillBar"
import Header from "../components/Header";
import "./Skills.css"

export default function Connect() {
    return (
        <div className="skills mx-auto" id="skills">
            <Header title={"Skills"} caption={"These are some of the skills that I've picked up over the years.  Each skill is rated 0-100 with 0 meaning I'm a beginner and 100 meaning advanced profieciency."} />
            <div className="skills-container">
                <SkillBar name={"Python"} level={85} color={"orange"}/>
                <SkillBar name={"JavaScript"} level={75} color={"orange"}/>
                <SkillBar name={"HTML"} level={70} color={"orange"}/>
                <SkillBar name={"C++"} level={70} color={"orange"}/>
                <SkillBar name={"Java"} level={60} color={"orange"}/>
            </div>
        </div>
    )
}
